# OEIS sequence: A217261

def generate(limit: int) -> list:
    numbers = set()
    # For very large range this list must be expanded:
    for n in [2, 3, 5, 7]:
        m = 2
        j = n * n
        while m**j <= limit:
            numbers.add(m**j)
            m += 1
    return sorted(numbers)
